import React from 'react'

export const Profile = () => {
  return (
    <div class="intro container">
    <p>I'm a multi-disiplinary software engineer with a passion for user-focused frontend development. I'm a creative problem solver with a background in media production, photography, and marketing.
      I'm currently looking for a new role as a frontend developer or full stack with a focus on frontend.
    </p>
    <a href="mailto: jaywen89@gmail.com"><button><span>Contact Me</span></button></a>
  </div>
  )
}
